import React, { useEffect, useState } from "react";
import SignleReport from "./SingleReport";


function Reports() {

    function App() {
        const [reports, setReports] = useState([{
            state: '',
            type: '',
            message: ''
        }]);

        useEffect(() => {
            fetch("/reports")
                .then(res => {
                    if (res.ok) {
                        console.log(res)
                        return res.json()
                    }
                }).then(jsonRes =>
                    setReports(jsonRes));
        }, [])


        return <div className="container">
            <h1 className="display-3">Report Page</h1>
            <ul className="list">

            </ul>
        </div>
    }
}

export default Reports;
